import React from 'react'
import Marker from './Marker';

const Markers = ({markers}) => {
    return (
        <div>
            <center><h1>Contact List</h1></center>
            {markers.map((marker) => 
             <Marker
             text={marker.address}
             lat={marker.latitude}
             lng={marker.longitude}
             />
            )}
        </div>
    )
};

export default Marker
